import React, { useState, useEffect } from "react";
import { Navbar } from "../index";
import "./Pickup.css";

function Pickup() {
  const [formData, setFormData] = useState({
    parcel: "0",
    pickupDate: "",
    pickupTime: "0",
    pickupLocation: "",
    province: "0", // Changed to lowercase 'province'
  });

  const [parcelOptions, setParcelOptions] = useState([]);
  const [provinces, setProvinces] = useState([]); // Added provinces state

  useEffect(() => {
    fetch("http://localhost:3333/Shipping")
      .then((response) => response.json())
      .then((data) => {
        if (data.status === "ok") {
          setProvinces(data.provinces);
        } else {
          console.error("Error fetching provinces:", data.message);
        }
      })
      .catch((error) => {
        console.error("Error fetching provinces:", error);
      });
  }, []);


  const fetchProvinces = () => {
    fetch("http://localhost:3333/Shipping")
      .then((response) => response.json())
      .then((data) => {
        if (data.status === "ok") {
          setProvinces(data.provinces);
        } else {
          console.error("Error fetching provinces:", data.message);
        }
      })
      .catch((error) => {
        console.error("Error fetching provinces:", error);
      });
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Send form data to backend
    fetch("/your-backend-api-endpoint", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(formData),
    })
      .then((response) => {
        if (response.ok) {
          console.log("Data submitted successfully");
          setFormData({
            parcel: "0",
            pickupDate: "",
            pickupTime: "0",
            pickupLocation: "",
            province: "0",
          });
        } else {
          console.error("Failed to submit data");
        }
      })
      .catch((error) => {
        console.error("Error occurred:", error);
      });
  };

  return (
    <div>
      <Navbar />
      <div className="Pickup-container" id="container">
        <div className="Pickup-form-container">
          <form onSubmit={handleSubmit}>
            <h1 className="header">Pickup request</h1>
            <span>select location and date for pickup service</span>
            <br />
            <br />

            {/* Parcel selection */}
            <div className="form-group row">
              <label className="col-sm-4 col-form-label">
                <span className="lb_IDCard">Select parcel</span>
              </label>
              <div className="enterdata">
                <select
                  name="parcel"
                  value={formData.parcel}
                  onChange={handleInputChange}
                >
                  {parcelOptions.map((parcelOption, index) => (
                    <option key={index} value={parcelOption}>
                      {parcelOption}
                    </option>
                  ))}
                </select>
              </div>
            </div>
            {/* Pickup date */}
            <div className="form-group row">
              <label className="col-sm-4 col-form-label">
                <span className="lb_IDCard">Pickup date</span>
              </label>
              <div className="enterdata">
                <input
                  type="date"
                  name="pickupDate"
                  value={formData.pickupDate}
                  onChange={handleInputChange}
                />
              </div>
            </div>
            {/* Pickup time */}
            <div className="form-group row">
              <label className="col-sm-4 col-form-label">
                <span className="lb_IDCard">Pickup time</span>
              </label>
              <div className="enterdata">
                <select
                  name="pickupTime"
                  value={formData.pickupTime}
                  onChange={handleInputChange}
                >
                  <option value="0">10:00 - 13:00</option>
                  <option value="1">13:00 - 15:00</option>
                  <option value="2">15:00 - 17:00</option>
                </select>
              </div>
            </div>
            {/* Pickup location detail */}
            <div className="form-group row">
              <label className="col-sm-4 col-form-label">
                <span className="lb_IDCard">Pickup location detail</span>
              </label>
              <div className="enterdata">
                <input
                  type="text"
                  name="pickupLocation"
                  value={formData.pickupLocation}
                  onChange={handleInputChange}
                  placeholder="Enter address details"
                />
              </div>
            </div>
            {/* Provinces/District/Sub-district/zip code */}
            <div className="form-group row">
              <label className="col-sm-4 col-form-label">
                <span className="lb_IDCard">
                  Provinces/District/Sub-district/zip code
                </span>
              </label>
              <div className="enterdata">
                <select
                  name="province"
                  value={formData.province}
                  onChange={handleInputChange}
                >
                  <option value="">Select Province</option>
                  {provinces &&
                    provinces.map((province) => (
                      <option key={province.code} value={province.code}>
                        {province.name_th}
                      </option>
                    ))}
                </select>
              </div>
            </div>
            <br />
            {/* Submit Button */}
            <button type="submit">Submit</button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Pickup;
